import Layout from '../components/Layout'
import Form from '../components/Form'

const api_url = "https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan"

const Index = () => (
    <Layout>
        <div>
            <Form/>
        </div>
    </Layout>
);

async function test() {
    const res = await fetch(api_url, {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify(
            {
                "laanebelop": 200000,
                "nominellRente": 3,
                "terminGebyr": 30,
                "utlopsDato": "2030-01-01",
                "saldoDato": "2020-01-01",
                "datoForsteInnbetaling": "2020-02-01",
                "ukjentVerdi": "TERMINBELOP" 
            }
        )
    })
    
    const data = await res.json()
    console.log(data)
} 



export default Index;
